FeedPackage.Description:
Spire.OfficeViewer for .NET is a powerful Office Viewer component for .NET. It enables developers to load Word, Excel, Presentation slides and PDF files and view them from code. As a standalone .NET class library, Spire.OfficeViewer mainly focus on how to display office documents and PDF files. It enables developers/programmers to directly view and print office files and PDFs for their .NET applications. It supports to view the DOC, DOCX, DOT, XLS, XLSX, XLSB, ODS, PPT, PPTX, PPS, PPSX and PDF file formats.

Spire.OfficeViewer is a totally independent .NET library which doesn't need to install Microsoft Office and Adobe Reader or any other 3rd party software/library on system.

Main Functions

    Load office documents and PDF from file and view;
    Switch to target page
    Fit page; Fit width; Fit height
    Page down/up;
    Zoom in/out;
    Hand tool;
    Print;

